import React from "react";

class Logo extends React.Component {
  render() {
    return (
      <div>
        <div>
          <svg viewBox="0 0 200 100" xmlns="http://www.w3.org/2000/svg">
            <ellipse cx="50" cy="100" rx="50" ry="100" />
          </svg>
        </div>
        <div>Portal</div>
      </div>
    );
  }
}

export default Logo;
